/**
 * Created by Lenovo on 2019/8/4.
 */
import React from 'react';
import {HashRouter, BrowserRouter,Route,Redirect,Switch,Link,NavLink} from 'react-router-dom';
import Index from './pages/index/index';
import IndexDetail from './pages/index/indexDetail';
import Personal from './pages/personal/personal';
import App from './pages/app/App';
import MessageList from '../message/messageList';
import Login from './pages/login/login';
import Register from './pages/register/register';
import MessageDetail from './pages/message/messageDetail';
import Publish from './pages/personal/publish';
import Buy from './pages/personal/buy';
import Sale from './pages/personal/sale';
import ModifyPwd from './pages/personal/modifyPwd';
const Router = () => (
    <BrowserRouter>
        <Route  exact  path="/"   component={App}/>
        <Route  exact  path="/app"   component={App}/>
        <Route  exact  path="/index"   component={Index}/>
            <Route  exact  path="/index"   component={Index}/>
            <Route  exact  path="/index"   component={Index}/>
        <Route  exact  path="/indexDetail"   component={IndexDetail}/>
        <Route  exact  path="/login"   component={Login}></Route>
        <Route  exact  path="/register"   component={Register}></Route>
        <Route  exact  path="/message"   component={MessageList}></Route>
        <Route  exact  path="/messageDetail"   component={MessageDetail}></Route>
        <Route exact  path="/publish"   component={Publish}></Route>
        <Route exact  path="/sale"   component={Sale}></Route>
        <Route exact  path="/buy"   component={Buy}></Route>
        <Route exact  path="/modifyPwd"   component={ModifyPwd}></Route>
    </BrowserRouter>
);
export default Router;
